import { db, auth } from './firebaseConfig.js';
import { collection, getDocs, query, where } from 'https://www.gstatic.com/firebasejs/9.17.1/firebase-firestore.js';
import { signOut } from 'https://www.gstatic.com/firebasejs/9.17.1/firebase-auth.js';

// Referencias a elementos
const startDateSales = document.getElementById('start-date-sales');
const endDateSales = document.getElementById('end-date-sales');
const employeePercentageInput = document.getElementById('employee-percentage');
const generateSalesReportButton = document.getElementById('generate-sales-report');
const startDateAppointments = document.getElementById('start-date-appointments');
const endDateAppointments = document.getElementById('end-date-appointments');
const generateAppointmentsReportButton = document.getElementById('generate-appointments-report');
const backButton = document.getElementById('back');
const logoutButton = document.getElementById('logout');

// Logo en Base64 (aseg√∫rate de reemplazar esta cadena por el base64 real de tu logo)
const logoBase64 = 'data:image/png;base64,
';

// Funci√≥n para generar reporte de ventas en PDF
async function generateSalesReport() {
    if (!startDateSales.value || !endDateSales.value) {
        alert('Seleccione ambas fechas.');
        return;
    }

    const percentage = parseFloat(employeePercentageInput.value) || 0;

    const q = query(
        collection(db, 'ventas'),
        where('fecha', '>=', startDateSales.value),
        where('fecha', '<=', endDateSales.value)
    );

    const querySnapshot = await getDocs(q);
    const reportData = [];
    let totalValue = 0;

    querySnapshot.forEach((doc) => {
        const data = doc.data();
        reportData.push(data);
        totalValue += data.valor;
    });

    const employeeEarnings = totalValue * (percentage / 100);

    // Llamada a funci√≥n para generar el PDF usando PDFMake
    const docDefinition = {
        content: [
            {
                image: logoBase64, // Incluir el logo
                width: 150, // Ajustar el tama√±o del logo
                margin: [0, 0, 0, 20], // Margen para separar el logo del contenido
            },
            { text: 'Reporte de Ventas', fontSize: 18, bold: true, color: '#3498db' }, // T√≠tulo en color azul
            {
                table: {
                    body: [
                        ['Fecha', 'Productos', 'Valor', 'Tipo de Pago', 'Cuenta'].map(text => ({ text, bold: true, fillColor: '#3498db', color: 'white' })), // Cabecera con color de fondo
                        ...reportData.map(item => [
                            item.fecha,
                            item.productos || item['que se hara'],
                            `$${item.valor}`,
                            item.t_pago,
                            item.cuenta ? `(${item.cuenta})` : '',
                        ]),
                    ]
                },
                layout: 'lightHorizontalLines',
            },
            { text: `Total de Ventas: $${totalValue.toFixed(2)}`, margin: [0, 10], color: '#3498db' },
            { text: `Porcentaje para Empleado (${percentage}%): $${employeeEarnings.toFixed(2)}`, color: '#3498db' },
        ],
        styles: {
            header: {
                fontSize: 16,
                bold: true,
                color: '#34495e',
            },
            table: {
                margin: [0, 5, 0, 15],
            }
        },
        pageMargins: [40, 60, 40, 60], // Margenes de la p√°gina
    };

    pdfMake.createPdf(docDefinition).download('Reporte_de_Ventas.pdf');
}

// Funci√≥n para generar reporte de citas en PDF
async function generateAppointmentsReport() {
    if (!startDateAppointments.value || !endDateAppointments.value) {
        alert('Seleccione ambas fechas.');
        return;
    }

    const q = query(
        collection(db, 'citas'),
        where('fecha', '>=', startDateAppointments.value),
        where('fecha', '<=', endDateAppointments.value)
    );

    const querySnapshot = await getDocs(q);
    const reportData = [];

    querySnapshot.forEach((doc) => {
        reportData.push(doc.data());
    });

    // Llamada a funci√≥n para generar el PDF
    const docDefinition = {
        content: [
            {
                image: logoBase64, // Incluir el logo
                width: 150, // Ajustar el tama√±o del logo
                margin: [0, 0, 0, 20], // Margen para separar el logo del contenido
            },
            { text: 'Reporte de Citas', fontSize: 18, bold: true, color: '#3498db' }, // T√≠tulo en color azul
            {
                table: {
                    body: [
                        ['Fecha', 'Que se har√°', 'Asisti√≥'].map(text => ({ text, bold: true, fillColor: '#3498db', color: 'white' })), // Cabecera con color de fondo
                        ...reportData.map(item => [
                            item.fecha,
                            item['que se hara'],
                            item.asistio ? 'S√≠' : 'No'
                        ]),
                    ]
                },
                layout: 'lightHorizontalLines',
            }
        ],
        styles: {
            header: {
                fontSize: 16,
                bold: true,
                color: '#34495e',
            },
            table: {
                margin: [0, 5, 0, 15],
            }
        },
        pageMargins: [40, 60, 40, 60], // Margenes de la p√°gina
    };

    pdfMake.createPdf(docDefinition).download('Reporte_de_Citas.pdf');
}

// Eventos de los botones
generateSalesReportButton.addEventListener('click', generateSalesReport);
generateAppointmentsReportButton.addEventListener('click', generateAppointmentsReport);

backButton.addEventListener('click', () => {
    window.location.href = 'menu.html';
});

logoutButton.addEventListener('click', () => {
    signOut(auth).then(() => {
        window.location.href = "index.html";
    }).catch((error) => {
        console.error("Error al cerrar sesi√≥n:", error);
    });
});
